import Home from './pages/home/Home';
import Login from './pages/login/Login';
import ListDoctor from './pages/ListDoctor/ListDoctor';
import ListNews from './pages/ListNews/ListNews';
import NewDataDoctor from './pages/newDataDoctor/NewDataDoctor';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import { userInputs } from './formSource';
import './style/dark.scss';
import { useContext } from 'react';
import { DarkModeContext } from './context/darkModeContext';
import { AuthContext } from './context/AuthContext';


function App() {
  const { darkMode } = useContext(DarkModeContext);

  const { currentUser } = useContext(AuthContext);

  const RequireAuth = ({ children }) => {
    return currentUser ? children : <Navigate to="/login" />;
  };

  return (
    <div className={darkMode ? 'app dark' : 'app'}>
      <BrowserRouter>
        <Routes>
          <Route path="/">
            <Route path="login" element={<Login />} />
            <Route
              index
              element={
                <RequireAuth>
                  <Home />
                </RequireAuth>
              }
            />
            <Route path="doctorPage">
              <Route
                index
                element={
                  <RequireAuth>
                    <ListDoctor />
                  </RequireAuth>
                }
              />
              <Route
                path="newDataDoctor"
                element={
                  <RequireAuth>
                    <NewDataDoctor inputs={userInputs} title="Add New Doctor" />
                  </RequireAuth>
                }
              />
            </Route>
            {/* <Route path="hospitalPage">
              <Route
                index
                element={
                  <RequireAuth>
                    <List />
                  </RequireAuth>
                }
              />
            </Route> */}
            <Route path="newsPage">
              <Route
                index
                element={
                  <RequireAuth>
                    <ListNews />
                  </RequireAuth>
                }
              />
              <Route
                path="newDataNews"
                element={
                  <RequireAuth>
                    <NewDataNews inputs={userInputs} title="Add New News" />
                  </RequireAuth>
                }
              />
            </Route>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
